import { PAGE_GAME, PAGE_ACCOUNT, PAGE_HOME, TITLES } from './Const';
import { useState, useEffect } from 'react';
import { Sections } from './Const.js'
import './Account.css'

const SECTIONS = new Sections()

export const Account = (loggedIn, setLoggedIn) => {
	const [currentSection, setCurrentSection] = useState(loggedIn ? SECTIONS.login : SECTIONS.profile)
	return (
		<div id="account">
			<h1>{TITLES[currentSection]}</h1>
		</div>
	)
}
